import Home from './pages/Home.vue';
import Sort from './pages/Sort.vue';
import PriorityQueue from './pages/PriorityQueue.vue';

const routes = [
  { path: '/', component: Home },
  { path: '/sort', component: Sort },
  { path: '/priority-queue', component: PriorityQueue },
];

export default routes;
